    <script>
        function playAudio() {
            var audio = document.getElementById("audio");
            audio.play();
        }
        document.addEventListener("DOMContentLoaded", function () {
            var button = document.getElementById("myButton");
            setTimeout(() => {
                button.click();
                addPopEffect("svg");
            }, 1500)
        });
        const image = document.getElementById('myDIV');
        const skeletonScreen = document.getElementById('skeleton-screen');

        image.addEventListener('load', () => {
            skeletonScreen.style.display = 'none';
        });
        function addPopEffect(element) {
            document.getElementById(element).classList.add('pop');
            setTimeout(() => {
                document.getElementById(element).classList.remove('pop');
            }, 300);
        }
        document.getElementById("res").innerHTML = localStorage.getItem("correct")/5*100+"%"
